class ProApplication extends HTMLElement {

  connectedCallback() {
    this.getApplication();
    this.bindFormEvents();
    this.configDropzone();
  }

  getApplication() {
    var self = this;
    $.getJSON("/apps/pros/pro-app", function(data) {
      if(data.employerType){
        $("#ProApplicationEmployerType").val(data.employerType);
      }
      if(data.employer){
        $("#ProApplicationEmployerName").val(data.employer);
      }
      data.files && data.files.forEach(function(file) {
        self.dropzone.displayExistingFile({
          name: file.name,
          id: file.id,
        }, file.preview, null, "anonymous");
      })
    });
  }

  bindFormEvents() {
    var self = this;
    $("#ProApplicationSubmit").click(function(event) {
      $("#ProApplicationForm").trigger("submit");
    })
    $("#ProApplicationForm").submit(function(event) {

      event.preventDefault();

      if(this.checkValidity() && self.dropzone.files.length){

        let post_url = $(this).attr("action");
        let request_method = $(this).attr("method");
        let form_data = self.getFormData($(this));

        $.ajax({
            url: post_url,
            type: request_method,
            dataType: 'json',
            contentType: "application/json",
            data: JSON.stringify(form_data)
          }).done(function(data) {

            if (!data.success) {
              if (data.errors.employer) {
                $("#ProApplicationemployerName").addClass("has-error");
                $("#ProApplicationemployerName").append(
                  '<div class="help-block">' + data.errors.employer + "</div>"
                );
              }
            } else {
              $("#form-submit-success").show();
              $("#ProApplicationForm").hide();
              $("#ProApplicationFilesWrap").hide();
              $("#ProApplicationSubmit").hide();
            }

          })
          .fail(function (data) {
              $("#ProApplicationForm").html(
                '<div class="alert alert-danger">Could not reach server, please try again later.</div>'
              );
          });

      }else{
        self.reportFileValidity();
        this.reportValidity()
        return false;

      }
    });
  }

  reportFileValidity(){
    const validFiles = this.dropzone.files.filter(function(file){
      return file.status !== "error"
    });
    if(validFiles.length){
      this.filesError?.remove();
    }else{
      $("#ProApplicationFiles").addClass("has-error");
      this.filesError = $('<div class="alert alert-danger">Please upload at least one file.</div>')
      $("#ProApplicationFiles").append(this.filesError);
    }
  }

  configDropzone(){
    var self = this;
    this.dropzone = new Dropzone("#ProApplicationFiles", {
      url: "/apps/pros/pro-app/file",
      acceptedFiles: "image/*,application/pdf",
      dictDefaultMessage: "Drag files here or click to select and upload.<br/>(.jpg, .png, .pdf)",
      addRemoveLinks: true,
    });

    this.dropzone.on('success', function(file, repsonse) {
      if(repsonse?.uploads?.length){
        file.id = repsonse.uploads[0].id;
      }
    });

    this.dropzone.on("removedfile", function(file, response) {

        const x = confirm('Do you want to delete?');
        if(!x) return false;

        $.ajax({
          url: "/apps/pros/pro-app/file",
          type: "DELETE",
          dataType: 'json',
          contentType: "application/json",
          data: JSON.stringify({
            id: file.id
          }),
          success: function(data) {
            console.log("Success deleting file");
          }
        });
    });
  }

  getFormData($form) {
    var unindexed_array = $form.serializeArray();
    var indexed_array = {};

    $.map(unindexed_array, function(n, i){
        indexed_array[n['name']] = n['value'];
    });

    return indexed_array;
  }
}

window.customElements.define('pro-application', ProApplication);

class ProApplicationSection extends HTMLElement {
  constructor() {
    super();

  }

}

window.customElements.define('pro-application-section', ProApplicationSection);